import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom"
import NavBar from './Pages/NavBar';
import Home from './Pages/Home';


function App(){
  return(
    <div >
      <Router>
        <NavBar />
        <Routes>
          <Route exact path="/" element={<Home />} />
        </Routes>
      </Router>
    </div>
  )
}

export default App;
